import "./App.css";
import React from "react";
import { Provider } from "react-redux";
import store from "./store";

import Floating from "./components/Floating";

function App() {
  return (
    <Provider store={store}>
      <React.StrictMode>
        <Floating />
      </React.StrictMode>
    </Provider>
  );
}

export default App;
